import { createSlice } from "@reduxjs/toolkit";

const etc = createSlice({
    name: "etc", //state 이름
    initialState: {
        checkedList: [],
    },
    reducers:{
        checkedList: (state, action) => {
            state.checkedList = action.payload;
        },
    }
});

export const {
    checkedList, 
} = etc.actions;
export default etc;
